import React from 'react';

import Button from '../../UserInterface/Buttons/Button';
import CoinFinalLevelBlock from '../../UserInterface/Coins/CoinFinalLevelBlock';

function LevelBlockWord(props) {

    return (
        <div className="automation-buttons-blocks">
            {
                props.data === 11 ?
                    <div
                        onClick={props.onclickNextLevel}
                        data={props.nextNumberBlock}
                    >
                        Молодец!!! Продолжим дальше?
                        
                    </div>

                    :<div>
                        <div>{props.data}</div>
                        <Button
                            name={props.name}
                            onclick={props.onclickWord}
                            data={props.data}
                        />
                    </div>
            }
            <CoinFinalLevelBlock
                classname='coin-final-level-block-wrapper'
                classnameFinalCoin='coin-final-level-block'
                coin={props.coin}
                flagLevelFinal={props.flagLevelFinal}
            />
        
         </div>
     )
}

export default LevelBlockWord
